INSERT INTO location (title, description, coordinateY, coordinateX, created, uri) VALUES ('Strma reber', 'Strma Reber je serpentinast prelaz, ki povezuje Kočevsko Reko in Osilnico. Strma Reber je poimenovana tudi "Medvedje Črevo", sestavlja pa jo 19 serpentin pod kotom 180° s povprečnim naklonom 8,8 %, ter največjim naklonom 17 %. Vrh prelaza Strma Reber se nahaja na nadmorski višini 993 m.', 45.55068002284734, 14.713020727276032, TIMESTAMP '2023-01-07 15:36:38', 'https://www.kocevsko.com/sl/poi/strma-reber/');
INSERT INTO location (title, description, coordinateY, coordinateX, created, uri) VALUES ('Postonjska jama', 'Dobrodošli v najbolj atraktivni jami na svetu in največji turistični jami v Evropi! V 24-kilometrskem jamskem sistemu občutite čarovnijo podzemnega sveta in doživite edinstveno vožnjo s podzemnim vlakcem.', 45.79527937860461, 14.201250617310098, TIMESTAMP '2023-01-14 15:36:38', 'https://www.postojnska-jama.eu/sl/');
